<# 
.AUTHOR
	Edward Fong (edwardfongabq@gmail.com)

.SYNOPSIS
    The Hasher GUI allows the user to check files against file hashes.

.DESCRIPTION 
    The Hasher is a GUI based on PowerShell that allow the user to add a hash string to a textbox field. A file open button opens a file explorer
	to choose the file that you want to run the hash against. The application uses the PowerSWhell Get-FileHash commandlet to run get the hash of the file. You can also choose the encryption algorithm via a ComboBox Dropdown. The encryption choices are SHA1, SHA256, SHA384, SHA512, and MD5. ONce both choices are set, clicking the Check Hash button will display the result, whether or not the hash mathces. 
#>

Add-Type -AssemblyName System.Windows.Forms
Add-Type -AssemblyName System.Drawing
Add-Type -AssemblyName PresentationFramework
[System.Windows.Forms.Application]::EnableVisualStyles()

# Global Variables
$global:filehash 		= ""
$global:algo 			= ""
$global:filename 		= ""

# Create Box
$GuiBox					= New-Object System.Windows.Forms.Form

# Define the dimensions of the box
$GuiBox.ClientSize		= '386, 180'
$GuiBox.text			= "The Hasher"
$GuiBox.BackColor		= "#ffffff"
$GuiBox.StartPosition 	= 'CenterScreen'

$iconBase64				= ''

$iconBytes					= [Convert]::FromBase64String($iconBase64)
$stream						= [System.IO.MemoryStream]::new($iconBytes, 0, $iconBytes.Length)
$GuiBox.Icon				= [System.Drawing.Icon]::FromHandle(([System.Drawing.Bitmap]::new($stream).GetHIcon()))

# Label for Entering Hasher
$label 						= New-Object System.Windows.Forms.Label
$label.Location 			= New-Object System.Drawing.Point(10,10)
$label.Size 				= New-Object System.Drawing.Size(280,20)
$label.Text 				= 'Please enter the hash below:'
$label.Font 				= [System.Drawing.Font]::new("Microsoft Sans Serif", 12, [System.Drawing.FontStyle]::Bold)

# Add Input for Hash Entry
$textBox 					= New-Object System.Windows.Forms.TextBox
$textBox.Location 			= New-Object System.Drawing.Point(10,37)
$textBox.Size 				= New-Object System.Drawing.Size(360,20)
$textBox.Font				= 'Microsoft Sans Serif, 10'

#DropDown Button
$dropdown 					= New-Object System.Windows.Forms.ComboBox
$dropdown.Text				= ""
$dropdown.width 			= 170
@('----Select Encryption----','SHA1', 'SHA256', 'SHA384', 'SHA512', 'MD5') | ForEach-Object{[void]$dropdown.items.Add($_)}
$dropdown.SelectedIndex 	= 0
$dropdown.Location	 		= New-Object System.Drawing.Point(10,70)
$dropdown.Font				= 'Microsoft Sans Serif, 10'
$dropdown.add_selectedIndexChanged({
	$global:algo = $dropdown.SelectedItem.tostring()
})

#Output Label
$outputLabel				= New-Object System.Windows.Forms.Label
$outputLabel.Location		= New-Object System.Drawing.Point(10,143)
$outputLabel.Size			= New-Object System.Drawing.Size(240, 20)
$outputLabel.Text 			= ""
$outputLabel.Font 			= [System.Drawing.Font]::new("Microsoft Sans Serif", 14, [System.Drawing.FontStyle]::Bold)

# File Browser
	$openFileBrowser 		= {
									$FileBrowser = New-Object System.Windows.Forms.OpenFileDialog -Property @{ InitialDirectory = [Environment]::GetFolderPath('Desktop') }							
									$null = $FileBrowser.ShowDialog()
									$global:filename = $FileBrowser.filename
									$global:filehash = Get-FileHash $global:filename -Algorithm $global:algo #SHA1
									# for testing--$outputLabel.Text = $global:filehash.Hash
									# For testing--Write-Host $global:algo
}

# Add File Open Button
$fileOpenButton 			= New-Object System.Windows.Forms.Button
$fileOpenButton.Location 	= New-Object System.Drawing.Point(35,110)
$fileOpenButton.Size		= New-Object System.Drawing.Size(75,23)
$fileOpenButton.Text 		= 'Open File'
$fileOpenButton.Add_Click($openFileBrowser)

# Check Button
$checkHashButton = {
		$global:filehash 	= Get-FileHash $global:filename -Algorithm $global:algo #SHA1
									if($textBox.Text -eq $global:filehash.hash) {	
										$outputLabel.Text = "File Mathches Hash"
									} else { 
										$outputLabel.Text = "File Doesn't Match Hash" 
									} 
		
}
$checkButton 				= New-Object System.Windows.Forms.Button
$checkButton.Location 		= New-Object System.Drawing.Point(120,110)
$checkButton.Size 			= New-Object System.Drawing.Size(85,23)
$checkButton.Text 			= 'Check Hash'
$checkButton.Add_Click($checkHashButton)

# Add Elements to Box
$GuiBox.Controls.Add($label)
$GuiBox.Controls.Add($textBox)
$GuiBox.Controls.Add($fileOpenButton)
$GuiBox.Controls.Add($checkButton)
$GuiBox.Controls.Add($outputLabel)
$GuiBox.Controls.Add($checkButton)
$GuiBox.Controls.Add($dropdown)

# Display Form
[void]$GuiBox.ShowDialog()
